import ExpenseItemCss from './ExpenseItem.css';

function ExpenseItem(){
    return (
        <div>
            <div>
            March 28th, 2016
            </div>
            <div>
                <h2>Car Insurance</h2>
                <div>$203.3</div>
            </div>
        </div>
    );
}
export default ExpenseItem;
